import React from 'react';
import './About.css';

const About = () => {
    return(
        <div className='about'>
            <p>Dmitriy Kozyrenko</p>
            <p>25 years old</p>
            <p>Homel, Belarus</p>
            <p>GTEK</p>
        </div>
    );
}

export default About;
